Yaşayış kompleksi «FORTUNA» Bakının Səbail rayonunda yerləşir. Kompleksdə ümumi sahəsi 250 kv.m. olan 4 otaqlı mənzil satılır. Mənzil 1 mərtəbəli binanın 13-cu mərtəbəsində yerləşir. Mənzil temirsizdir. Geniş zal və xoll , OTAQLARDA BÖYÜK VİTRAJ PƏNCƏRƏLƏR, 2 s/q. Mənzil əla layihəlidir yelçəkəndir(skvozonoy) Bina yüksək keyfiyyətli materiallardan tikilib, fasad isə enerji səmərəliliyinə görə müasir tələblərə cavab verərək etibarlı şəkildə izolyasiya olunub. Binada hər blokda yük və sərnişin liftləri; əlavə elektrik generatoru; video nəzarət sistemi qurulmuş domofon sistemi.
Layihəyə görə nəzərdə tutulur:
• yaxınlığında möhtəşəm ticarət və əyləncə kompleksi;
• VİP restoran, kafe və çay evi;
• fitness-mərkəzi, hovuz;
• SPA.
S=223m2
