Şəkildə gördüyünüz bütün əşyalar qiymətə dacxildir.

Təkrarlanmayan dizayna, yüksək keyfiyyətli təmirə sahib 101kv 3 otaqlı mənzil.
Kombi sistemi (+ariston), cambalkon, blokda və balkonda 8 qapılı dərin plastik dolablar, yataq otağında dərin qarderob.

1 ci blok, 16-cı mərtəbə.

Çıxarış (kupça) var.

Kompleksdə:
Avtomobil dayanacağı (qaraj)
7/24 mühafizə;
Damafon sistemi;
Hər mərtəbəyə özəl mühafizə (alarm) sistemi;
3 sürətli lift;
Böyük uşaq meydançası;
Uşaq Bağçası;
Hazırlıq kursları;
Rəqs dərsləri;
Gözəllik salonları;
Oba, AL, və Kosmos marketləri fəaliyyət göstərir.
